/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './login.css';
import account from '../../images/login/account.png';
import password from '../../images/login/password.png';
import defaultAvatar from ''
import {Title} from '../../share';
import {getData, goNext} from '../../utils';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }

    render() {
        return <div className="cm-mlr-15">
            <div className="login-margin-40"><img src="" alt="" className="login-avatar"/></div>
            <div><img src="" alt="" className="cm-img-small"/><input type="text" placeholder="请输入账户"/></div>
            <div><img src="" alt="" className="cm-img-small"/><input type="password" placeholder="请输入密码"/></div>
            <div className="cm-btn">登录</div>
            <div className="cm-flex cm-jc-sb">
                <div>短信验证码登录</div>
                <div>忘记密码</div>
            </div>
            <div className="cm-tx-c">
                <span className="cm-btn-small">注册</span>
            </div>
        </div>
    }
}
